css:
.nuclide-diagnostics-pane-nav {
  display: flex;
  height: 28px;
  line-height: 22px;
  padding-bottom: 4px;
  /* Match padding right/left from .status-bar. */
  padding-left: 0.75em;
  padding-right: 0.75em;
}
.nuclide-diagnostics-pane-nav-left {
  flex: 1;
}
.nuclide-diagnostics-pane-linter-warning {
  display: flex;
  height: 28px;
  line-height: 22px;
  padding-bottom: 4px;
  /* Match padding right/left from .status-bar. */
  padding-left: 0.75em;
  padding-right: 0.75em;
  text-align: center;
  display: block;
}
.nuclide-diagnostics-pane-nav-right {
  flex: 1;
  text-align: right;
}
.nuclide-fixed-data-cell {
  display: inline-block;
}
.nuclide-diagnostics-pane-nav .key-binding-sm {
  border: none;
  line-height: 1;
  margin-left: 0;
  padding-bottom: 3px;
  padding-top: 3px;
}
.nuclide-diagnostics-label {
  margin-bottom: 0;
}
